function eiPDF() {
  var electricIreland = 'data:image/jpeg;base64,'

  var doc = new jsPDF();

doc.addImage(electricIreland, 'JPEG', 0, 0, 60, 40);

doc.setDrawColor(88, 166, 24);
doc.rect(135, 15, 70, 40); 

doc.setDrawColor(0, 117, 176);
doc.rect(25, 65, 110, 120); 
doc.setLineWidth(0.1);
doc.line(30, 135, 125, 135);


//Account Details
doc.setFontSize(10);
doc.setTextColor(100);

doc.setFontType("bold");
doc.text(140, 20, "Acount Number:"); 
doc.text(140, 30, "MPRN:"); 
doc.text(140, 40, "Date of Issue:"); 
doc.text(140, 50, "Invoice No:"); 

doc.setFontType("normal");
doc.text(170, 20, user_Details.accountNumber );
doc.text(170, 30, user_Details.MPRN);
doc.text(170, 40, ei_Statements.date_Of_Issue);
doc.text(170, 50, ei_Statements.invoice_No);

//Bill Address
doc.setFontSize(14);
doc.setTextColor(0, 159, 218);
doc.text(30, 75, 'This statement is for:');

doc.setFontSize(12);
doc.setTextColor(100);
doc.text(30, 85, user_Details.business_Name);
doc.text(30, 90, user_Details.business_Address + ", " + user_Details.city + ", " + user_Details.postcode);

doc.setFontSize(16);
doc.setTextColor(88, 166, 24);
doc.text(30,100, "Your Electricity Statement");

doc.setFontSize(12);
doc.setTextColor(100);
doc.setFontType("bold");

doc.setTextColor(0, 159, 218);
doc.text(30, 110, "Payment Date:");
doc.text(30, 125, "Payment Type:");
doc.text(30, 145, "Summary:");

doc.setTextColor(100);
doc.setFontType("normal");
doc.text(65, 110, ei_Statements.date_Of_Issue);
doc.setFontType("bolditalic");

doc.setFontType("normal");
doc.text(65, 125, "Direct Debit");

doc.setFontSize(16);
doc.text(30, 155, "Total Due:");
doc.setFontType("bold");
doc.text(80, 155, ei_Statements.total_Payment);

doc.setFontSize(12);
doc.setFontType("normal");
doc.text(30, 165, "Payment Made:");
doc.text(30, 175, "Payment Status:");

doc.text(80, 165, ei_Statements.payment_Made);

if(ei_Statements.processed == "Completed")
{
	doc.setTextColor(88, 166, 24);
	doc.text(80, 175, ei_Statements.processed);
}
else{
	doc.setTextColor(255, 0, 0);
	doc.text(80, 175, ei_Statements.processed);
}



    doc.save(user_Details.business_Name + "_Direct Debit_" + ei_Statements.date_Of_Issue + '.pdf');					 // Save the PDF with name "katara"...
}


